import React, { useState } from "react";

interface AllLogFiles {
  logFileName: string;
  logFilePath: string;
  changed: Date;
}

const [allLogFiles, setAllLogFiles] = useState<AllLogFiles[]>([]);

const fetchLogFiles = async () => {
  try {
    const response = await fetch("/logFile/listLogFiles", {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    });
    const data = await response.json();
    setAllLogFiles(data);
  } catch (error) {
    console.error("Error fetching log files:", error);
  }
};

export const ListLogFiles = () => {
  return (
    <div>
      <hr />
      <h3>Logfiles</h3>
      <ul>
        {allLogFiles.map((logFile) => (
          <li key={logFile.logFileName}>{logFile.logFileName}</li>
        ))}
      </ul>
    </div>
  );
};
